content:
@1nighthjy 

초록색 병을 마구 흔들고 장난스레 웃으며 투명한 유리잔에 차오르는 술을 본다. 이 차가운 술을 마시고 뜨겁게 몸은 달구어져간다. 그 뜨거운 살덩이가 가까이 다가가 불을 붙이고, 저 어두운 하늘을 아름답게 비추어갔다. 그래서, 좋았을까? 너는.
By 위우리

@ROMIII0324 그치?! 나도 내가 최고라고 생각했어!
뜨거운 국물에 차가운 술 먹으러 가자😁 (셋째주부터 반차가 가능해)
나의 술 친구 새롬이 간절한 요즘이야 룰루

@Dragon_prosess 그래, 좋은 사람이었지. 누구보다 노력할 줄 알고, 또 배려라는 걸 중요시 여기는 그런 사람이었어. 늦은 시간까지 내가 돌아오는 걸 기다리다가 돌아오면 차가운 술 대신 따뜻한 차를 대접해주면서 날 향해 웃어주는 얼굴이 참 예쁘기도 했고 말이야.

(그 동료의 미소를 난 아직까지 잊지 못했다.

&gt;

@game_minal 엘레노어는 편한 장소가 짱이야 파라… 얘도 딱히 별 이견 없을 거라 아마 이런 걸로 싸울 일은 없을 거 같아요. 싸울 일 적겠다…
그래도 온천 스파 잘 되어있는 곳 휴가지로 찾는 건 멈추지 않을 거 같네요 근처에 관광지나 놀 곳 적당히 있는지 알아보는 것도 겸사겸사.
따뜻한 온천에 차가운 술…

@Balberith_Trpg 술... 엘레노어가 술을? (인지부조화옴)
그래 따땃한 온천이라면 차가운 술도 먹어줘야지 응응
원래 여행 같이 다닐 때 햄같이 싸우는데 얘넨 진짜 그런 걸로 싸울 일은 없겠구나... 짱이다.. 김노아 왠지 놀이공원 투어 같은 거나 시켜줄 것 같고 그래요

@game_minal 술 마시고도 남을 나이잖아요 아무래도?
따땃한 온천... 차가운 술... 뭐, 같이 오랫동안 지내면 햄같이 싸우는 게 당연하다지만 얘네는 같은방 쓴게 몇년인데 싸우려면 진작 싸웠겠죠
놀이공원 투어면 꼭... 동물머리띠 써줘야해 꼬옥. 손에 츄러스도 들고.

@WagiAhin ひやす(冷やす) 히야스, 차게 하다는 뜻의 명사형이 '히야시'다. 
일본어인데 그냥 사람들이 입에서 입으로 전해져서 저따위 발음이 된거지ㅋㅋ
차가운 술 달라고 할때 "맥주 시야시 잘 된 거 주세여" 라고 해🤣🤣
